class DataProcessor:
    def derive_missing_fields(self, record: Dict) -> Dict:
        if 'amount' not in record and 'quantity' in record and 'unit_price' in record:
            record['amount'] = record['quantity'] * record['unit_price']
            print("Derived missing 'amount' field")
        return record

