class DataSynchronizer:
    def sync_d1_with_fpds(self, fpds_data: List[Dict]) -> str:
        d_file_data = [{'id': item.get('id'), 'synced_at': datetime.now()} for item in fpds_data]
        generator = FileGenerator()
        return generator.generate_d_file(d_file_data, 'D1')

class DatabaseManager:
    def __init__(self, db_path: str = ':memory:'):
        self.conn = sqlite3.connect(db_path)

    def update_sql_code(self, query_name: str, new_query: str) -> None:
        cursor = self.conn.cursor()
        cursor.execute("CREATE TABLE IF NOT EXISTS queries (name TEXT, query TEXT)")
        cursor.execute("INSERT OR REPLACE INTO queries VALUES (?, ?)", (query_name, new_query))
        self.conn.commit()
        print(f"Updated SQL query '{query_name}'")

